<?php

namespace Etu\Core\CoreBundle\Command;

use Etu\Core\CoreBundle\Entity\City;
use Symfony\Bundle\FrameworkBundle\Command\ContainerAwareCommand;
use Symfony\Component\Console\Input\InputArgument;
use Symfony\Component\Console\Input\InputInterface;
use Symfony\Component\Console\Input\InputOption;
use Symfony\Component\Console\Output\OutputInterface;

class ImportCitiesCommand extends ContainerAwareCommand
{
	/**
	 * @var string
	 */
	protected $modulesDirectory;

	/**
	 * Configure the command
	 */
	protected function configure()
	{
		$this
			->setName('etu:cities:import')
			->setDescription('Import cities')
		;
	}

	/**
	 * @param \Symfony\Component\Console\Input\InputInterface $input
	 * @param \Symfony\Component\Console\Output\OutputInterface $output
	 * @return void
	 */
	protected function execute(InputInterface $input, OutputInterface $output)
	{
        $em = $this->getContainer()->get('doctrine')->getManager();

        foreach ($this->cities as $cityData) {
            $city = new City();
            $city->setName($cityData['name']);
            $city->setSlug($cityData['slug']);
            $city->setPostalCodes($cityData['postalCodes']);
            $city->setPopulation($cityData['population']);
            $city->setLongitude($cityData['longitude']);
            $city->setLatitude($cityData['latitude']);

            $em->persist($city);
            $em->flush();
        }
	}
    
